import React from 'react';

function Footer() {
  return (
    <footer className="footer-container">
      <h5>Let's Get In Touch!</h5>
      <p>Feel free to reach out if you're looking for a developer, have a question, or just ant to connect.</p>
      <p>ruth</p>
    </footer>
  );
}

export default Footer;
